con:soapui-project.con:beforeRunScript:
// Import the required classes
import com.eviware.soapui.impl.rest.actions.oauth.OltuOAuth2ClientFacade;
import com.eviware.soapui.impl.rest.actions.oauth.*;
import com.eviware.soapui.support.editor.inspectors.auth.TokenType;
import com.eviware.soapui.model.support.ModelSupport;

// Get a project
def project = ModelSupport.getModelItemProject(context.getModelItem());

log.info "Running GetAccessToken event script..."
def ENV = project.activeEnvironment.name
log.info "Environment is $ENV..."

def oAuthProfileName = "azure-dev"
if (ENV == "azure-tst")
	oAuthProfileName = "azure-tst"
if (ENV == "azure-uat")
	oAuthProfileName = "azure-uat"
if (ENV == "azure-dev" || ENV == "azure-tst" || ENV == "azure-uat") {
	// Get the needed authorization profile
	def authProfile = project.getAuthRepository().getEntry(oAuthProfileName);

	//Create a facade object
	def tokenType = TokenType.ACCESS;
	def oAuthFacade = new OltuOAuth2ClientFacade(tokenType);

	// Request an access token in headless mode and assign it to the authorization profile we got earlier
	oAuthFacade.requestAccessToken(authProfile, true, true);

	// Access token retrieval may take time, so we need to pause the execution
	sleep(3000);

	def TokenStatus = authProfile.accessTokenStatus.toString()

	for (int i = 0; i < 60 && TokenStatus != "RETRIEVED_FROM_SERVER"; ++i)
	{
		log.info "Waiting for access token..."
		sleep(1000);
		TokenStatus = authProfile.accessTokenStatus.toString()
	}

	log.info "Access Token Status for $oAuthProfileName is: $TokenStatus"

	// Posts a new token to the script log
	log.info("Set new token: " + authProfile.getAccessToken());

}

